import React from 'react'
import '../../sass/Definitions.scss'

export const MindMapping = () => {
    return (
        <div className="def-wrapper">
            <h1>What is <u>Mind Mapping </u> ?</h1>
            <span><h1>Definition:</h1> Mind mapping is a visual tool that is used to organize and connect different ideas, concepts, and information. It is a graphical representation of information that helps to visualize, structure and organize information in a way that makes it easier to understand and remember.Mind mapping can be used for a variety of purposes, including brainstorming, problem-solving, note-taking, and planning.</span>
        </div>
    )
}
